import React from 'react';
import Card from './Card';

export default function CardList(props) {
  console.log('PROPS:', props);
  const { users } = props;
  return (
    <div>
      {users.map(user => (
        <Card
          name={user.name}
          age={user.age}
          about={user.about}
          key={user.id}
        />
      ))}
    </div>
  );
}
